import { useParams } from "react-router";

function ProductPage() {
  const { id } = useParams();
  return (
    <div className="product-container">
      <div className="product-page-img">Image</div>
      <div className="product-page-description">
        <h1>Title</h1>
        <h3>Description</h3>
        <h4>Price</h4>
        <button>BUY</button>
      </div>
    </div>
  );
}

export default ProductPage;
